import Button from "../../Button";

const Learn_Overall = ({ title, message, image, orderLink, light = false }) => {
  if (title === "model y" || title === "model 3") {
    light = true;
  }

  return (
    <section className={`padding${light && "text-slate-50"}`}>
      <div className="grid md:grid-cols-2 gap-5">
        <div className="md:w-1/2">
          <div className="">
            <h2>{title}</h2>
            <p>
              Design yours or get a trade-in estimate for your current vehicle.
            </p>
            <div className="flex">
              <Button
                to={orderLink}
                label="Custom Order"
                outline={light ? "dark" : "light"}
              />
              {light ? (
                <Button to="/" label="Get an Estimate" light />
              ) : (
                <Button to="/" label="Get an Estimate" />
              )}
            </div>
          </div>
        </div>
        <div className="md:w-1/2 flex-centralizer">
          <img src={image} alt={title} />
        </div>
      </div>
      <p className="md:w-2/3">{message}</p>
    </section>
  );
};

export default Learn_Overall;
